def singleton(cls):
    """
    create singleton by decorator
    :param cls:
    :return:
    """
    instance = {}

    def _singleton(*args, **kwargs):
        if cls not in instance:
            instance[cls] = cls(*args, **kwargs)
        return instance[cls]
    return _singleton


@singleton
class FailedIconHtml(object):

    def __init__(self):
        super().__init__()


    def list_files_recursive(self, base_path, suffix):
        file_list = [os.path.join(dp, f) for dp, dn, filenames in os.walk(base_path) for f in filenames if
                     os.path.splitext(f)[1] == suffix]

        ret = []
        for i in range(len(file_list)):
            ret.append(os.path.normpath(file_list[i]))
        return ret

